import React from 'react';

import CardList from '../components/CardList';
import SearchBar from '../components/SearchBar';

function App() {
    return (
        <div className="App">
            <div className="container searchApp">
                <SearchBar />
                <CardList />
            </div>
        </div>
    )
}

export default App;
